from Crypto.Util.number import getPrime
import random

def generate_large_prime(bits):
    return getPrime(bits)

def decrypt(enc_flag, primes, key):
    decrypted_values = []
    for enc_char in enc_flag:
        decrypted_char = enc_char ^ key
        for prime in reversed(primes):
            decrypted_char //= prime
        decrypted_values.append(chr(decrypted_char))
    return ''.join(decrypted_values)

